import React from "react";
import { Avatar } from "@material-ui/core";
const NavBarLogin = () => {
  return (
    <>
      <Avatar
        alt="user image"
        src={require("../../assets/images/no-user.jpg")}
        style={{ transform: scale(2) }}
      />
    </>
  );
};

export default NavBarLogin;
